All read operations require that the caller specify an index. Index data structures efficiently organize the data to support different read access patterns. Indexes may include the entire dataset or cover only a subset. This is useful for enabling sharding, where different Indexing Nodes may store different subsets of the dataset to reduce the storage requirements for a single Indexing Node or enable better read performance. Indexes are defined by an IndexRecord which has the following shape: Field Name Field Type Description db String The identifier of the database model being used. indexType String An identifier of the index type used for the respective database model. partition String The name of the entity or interface which should be covered by the index. options Object Options specific to the type of index. Example Index Records Given a dataset with the following data model: interface EthereumAccount { id: ID! address: String!
} type Contract implements EthereumAccount { id: ID! address: String!
} type User implements EthereumAccount { id: ID! address: String! name: FullName
} type FullName { first: String! last: String!
} Then, the following would be valid index names for that dataset: Index Name Description { db: "entitydb", indexType: "dictionary" } A basic key-value index supporting constant-time lookup of all entities in dataset. { db: "entitydb", "indexType: "dictionary", partition: "User" } A basic key-value index supporting constant-time lookup of User entities. { db: "entitydb", indexType: "searchTree", options: { sortBy: ["id"] } } A sorted key-value index supporting iteration through all entities, sorted by ID. { db: "entitydb", indexType: "searchTree", partition: "EthereumAccount", options: { sortBy: ["address"] }} A sorted key-value index supporting iteration through all entities implementing the EthereumAccount interface, sorted by the address field. { db: "entitydb", indexType: "searchTree", partition: "User", options: { sortBy: ["name.first", "name.last"] } } A sorted key-value index supporting iteration through all User entities, first sorted by the nested field name.first, then by the nested field name.last (i.e., a compound index).

