Filter predicates allow for declaratively asserting whether a value meets certain criteria. Filter predicates are expressed as objects that can be passed into several low-level index read operations, such as takeWhile and find. Structure Filter predicates are expressed through a simple DSL: type FilterPredicate = FilterPredicateAnd | FilterPredicateOr | FilterPredicateLeaf interface FilterPredicateAnd { and: [FilterPredicate];
} interface FilterPredicateOr { or: [FilterPredicate];
} type FilterPredicateLeaf = StringFilter | NumberFilter | BooleanFilter interface BaseFilter { // The field the predicate will be applied to. Nested fields may be // specified by concatenating field names with a "." // If no field is specified, the predicate will be applied to the value. This // is only supported if the value is a primitive type. field?: String;
} // If multiple filter clauses are supplied, they will be treated as a logical AND.
interface StringFilter extends BaseFilter { equals?: String; notEquals?: String; // Contains string contains?: String; // Does not contain string notContains?: String; startsWith?: String; notStartsWith?: String; endsWith?: String; notEndsWith?: String; // Less than lt?: String; // Less than or equal to lte?: String; // Greater than gt?: String; // Greater than or equal to gte?: String; // Contained in list in?: [String]; // Not contained in list notIn?: [String];
} // If multiple filter clauses are supplied, they will be treated as a logical AND.
interface NumberFilter extends BaseFilter { equals?: Number; notEquals?: Number; // Less than lt?: Number; // Less than or equal to lte?: Number; // Greater than gt?: Number; // Greater than or equal to gte?: Number; // Contained in list in?: [Number]; // Not contained in list notIn?: [Number];
} // If multiple filter clauses are supplied, they will be treated as a logical AND.
interface BooleanFilter extends BaseFilter { equals?: Boolean; notEquals?: Boolean;
} Example - Simple Value Filter Predicate { equals: 12
} Example - Object Filter Predicate { field: "fullName", contains: "Vitalik"
} Example - Filter Predicate with Boolean Operators and Nested Fields { and: [ { field: "name.first", equals: "Vitalik" }, { field: "name.last", equals: "Buterin" } ]
} Gas Cost The clauses in the filter predicate DSL can be grouped into several buckets of operation types, which share equivalent gas cost calculations: Operation Type Description Gas Cost Number Comparison Includes lt, lte, gt, gte, equals and notEquals clauses on Number types. opCostByteCompare * B where B is the number of bytes in the number type, and opCostByteCompare is set via governance. String Comparison Includes lt, lte, gt, gte, startsWith, notStartsWith, endsWith, notEndsWith, equals and notEquals clauses on String types. opCostCharCompare * N where N is the number of characters compared in order to complete the operation, and opCostCharCompare is set via governance. Bit Comparison Includes equals and notEquals clauses on Boolean types. Also used for combining two filter predicate clauses via the Boolean operators or and and (including the implicit and described above). opCostBitCompare where opCostBitCompare is set via governance. String Match Used for contains and notContains clauses on String types opCostStringSearch * (M + N) where N is the number of characters in the pattern being matched, and M is the number of characters in the string being searched. opCostStringSearch is set via governance.

