Relationships are defined on entities just like any other scalar type, except that the type specified is that of another entity. Example Define a Transaction entity type with an optional one-to-one relationship with a TransactionReceipt entity type: @entity
type Transaction { id: ID! transactionReceipt: TransactionReceipt
} @entity
type TransactionReceipt { id: ID! transaction: Transaction
} Example Define a Token entity type with a required one-to-many relationship with a TokenBalance entity type: @entity
