Reverse lookups can be defined on an entity through the @derivedFrom field. This creates a "virtual" field on the entity that may be queried but cannot be set manually through the mappings API. Rather, it is derived from the relationship defined on the other entity. The type of a @derivedFrom field must be a collection since multiple entities may specify relationships to a single entity. Example Define a reverse lookup from a User entity type to an Organization entity type: @entity
type Organization { id: ID! name: String! members: [User]!
} @entity
type User { id: ID! name: String! organizations: [Organization!] @derivedFrom(field: "members")
}
